import React from 'react'
import './SectionSingle.css'

export const SectionSingle = (props) => {
  return (
    <section
      style={{
        backgroundImage: `url(${props.backgroundImage})`,
        backgroundSize: 'cover',
        minHeight: `${props.minHeight}`,
      }}
      className="section-single"
    >
      {props.children}
    </section>
  )
}
